    return (
        <>
            <div className="homepage-body">
                <h1>HRnet</h1>
                <div>
                    <Link to={`/employees-table`}>View Current Employees</Link>
                </div>
                <h2>Create Employee</h2>
                <RegisterForm />
            </div>
        </>
    );
};

export default CreateEmployeePage;
